// Filter applies the EvidenceWhereInput filter on the EvidenceQuery builder.
func (i *EvidenceWhereInput) Filter(q *EvidenceQuery) (*EvidenceQuery, error) {
	if i == nil {
		return q, nil
	}
	p, err := i.P()
	if err != nil {
		if err == ErrEmptyEvidenceWhereInput {
			return q, nil
		}
		return nil, err
	}
	return q.Where(p), nil
}

